import LoginComp from "./LoginStyle";

export default function Login() {
  return (
    <LoginComp>
      <div className="login_inner">
        <div className="login_container">
          <h2>로그인</h2>
          <div className="login_form"></div>
        </div>
      </div>
    </LoginComp>
  );
}
